import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <li>
        <Link to="/quizzes">Quizzes</Link>
      </li>
      <li>
        <Link to="/questions">Questions</Link>
      </li>
    </header>
  );
};

export default Header;
